type Handlers = struct {
	HealthCheck []TestCase
	GetToken    []TestCase
	GetArticle  []TestCase
	GetArticles []TestCase
	GetComments []TestCase
	PutComment  []TestCase
}
type TestCase struct {
	method                   string
	requestURI               string
	totalArticlesInDb        int
	commentsPerArticle       int
	params                   gin.Params
	body                     string
	commentsToInsert         map[int]*structure.Comment
	response                 interface{}
	statusCode               int
	check                    interface{}
	bcryptHashGenerationCost int
	incorrectBody            bool
	imagesDir                string
	runHandlerTwice          bool
	appConfig                map[string]string
}

